import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <img src={require('../images/AnnieBlueLinkedInBanner.png')} alt="Anniston Fees Banner" className="banner-img" />
      <div className="header-content">
        <h1>Anniston Fees</h1>
        <h2>Software Engineering - Student</h2>
      </div>
    </header>
  );
};

export default Header;
